import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ForgotPassword from './Components/ForgotPassword';
import SignupForm from './Components/Signup'; // Ensure this is the correct path to your SignupForm.js
import Login from './Components/Login';
import PasswordChanged from './Components/PasswordChanged';
import Scan from './Components/Scan';
import Scanner from './Components/Scanner';
import PasswordReset from './Components/Newpassword';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<SignupForm />} />  {/* SignupForm as the default route */}
        <Route path="/forgot-password" element={<ForgotPassword />} />
        <Route path="/login" element={<Login />} />
        <Route path="/password-changed" element={<PasswordChanged />} />
        <Route path="/scan" element={<Scan />} />
        <Route path="/scanner" element={<Scanner />} />
        <Route path="/password-reset" element={<PasswordReset />} />
      </Routes>
    </Router>
  );
}

export default App;
